import React from "react";
import Post from "./Post";
import { } from "react-redux"


const Posts = ({posts}) => {
    if(!posts.length){
        return <p className="text-center">Постов пока нет</p>
    }
    return posts.map(post =><Post post={post} key={post}/>)
};


export default Posts
